import React from 'react'

import styled from 'styled-components'

const FicheLogement = styled.div`
  width: 1440px;
`

const LogementsProprietaires = styled.div`
  font-family: montserrat;
`

function Fiche() {
  return (
    <Fiche>
      <FicheLogement>
        <LogementsProprietaires>"propriété"</LogementsProprietaires>
      </FicheLogement>
    </Fiche>
  )
}
export default Fiche
